import React, { useEffect, useState } from 'react';

function AdminVolunteer() {
  const [eventVolunteerData, setEventVolunteerData] = useState([]);

  useEffect(() => {
    fetch('/api/admin/events-volunteers')
      .then((response) => response.json())
      .then((data) => setEventVolunteerData(data))
      .catch((error) => console.error('Error fetching data:', error));
  }, []);

  return (
    <div className="admin-volunteer-container">
      <h1>Admin Page</h1>
      {eventVolunteerData.map((eventData, index) => (
        <div key={eventData.eventId} className="event-section">
          <h3>{index + 1}. {eventData.eventName}</h3>
          {eventData.volunteers ? (
            <table>
              <thead>
                <tr>
                  <th>S.No</th>
                  <th>Name</th>
                  <th>ID</th>
                  <th>Email</th>
                  <th>Phone Number</th>
                </tr>
              </thead>
              <tbody>
                {eventData.volunteers.map((volunteer, vIndex) => (
                  <tr key={volunteer._id}>
                    <td>{vIndex + 1}</td>
                    <td>{volunteer.name}</td>
                    <td>{volunteer.collegeId}</td>
                    <td>{volunteer.email}</td>
                    <td>{volunteer.phoneNumber}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <p>No volunteers registered for this event.</p>
          )}
        </div>
      ))}
    </div>
  );
}

export default AdminVolunteer;
